import React from "react";
import Fruit from "./Fruit"

function FruitList({fruits, onDeleteFruit, onChangeFormData, onChangeSelectedOwner}) {

    return (
        fruits.map((f) => (<Fruit fruit={f} key={f.id} onDeleteFruit={onDeleteFruit} onChangeFormData={onChangeFormData} onChangeSelectedOwner={onChangeSelectedOwner}/>))
    );
}

export default FruitList;
